function get_all_parent($id)
{	
	$j = 0;
	$user_id =  $id;
	$parent = NULL;
	$sql = "select user_id as parent_id,
			case 
				when FIND_IN_SET($user_id,left_network) THEN 0
				when FIND_IN_SET($user_id,right_network) THEN 1
			end position
			from network_users where FIND_IN_SET($user_id,left_network) or  FIND_IN_SET($user_id,right_network)";
	$result = query_execute_sqli($sql);
	$num = mysqli_num_rows($result);
	if($num > 0)
	{
		while($row = mysqli_fetch_array($result))
		{
			$parent[0][$j] = $row['parent_id'];
			$parent[1][$j] = $row['position'];
			$j++;
		}
	}
	mysqli_free_result($result);
	return $parent;
}


function add_member_total_business($user_id,$amount,$pos,$date){
	$sql = NULL;
	$s_date = date("Y-m-01",strtotime($date));
	$e_date = date("Y-m-t",strtotime($date));
	switch($pos){
		case 0 : $pair_field = 'left_point';
				  break;
		case 1 : $pair_field = 'right_point';
				  break;
	}
	$sql = "select * from month_pair_point1 where user_id='$user_id' ";//and date between '$s_date' and '$e_date'";
	$query = query_execute_sqli($sql);
	$num = mysqli_num_rows($query);
	if($num > 0){
		while($row = mysqli_fetch_array($query)){
			$pair_id = $row['id'];
		}
		mysqli_free_result($query);
		$sql = NULL;
		$sql = "update month_pair_point1 set  $pair_field = $pair_field + $amount ,date='$date'
				where id = '$pair_id' and user_id = '$user_id' ";
	}
	else{
		$sql = NULL;
		$sql = "insert into month_pair_point1 (user_id, $pair_field, date) values('$user_id','$amount','$date')";
	}
	query_execute_sqli($sql);
}
